    false,nt"url": null,nt"notes": "The Satellite View of Alaska map layer
    is a 200-meter-resolution simulated-natural-color image of Alaska. Vegetation is
    generally green, with darker greens representing forest and lighter greens representing
    vegetative tundra. Vegetative tundra regions are composed of shallow rooted plants.
    Very bright areas, such as snow and ice, are colored blue. The image was produced
    by combining Landsat Thematic Mapper (TM) imagery from the Landsat 4 and Landsat
    5 satellites.",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
